import React from "react";
import styled from "styled-components";

function BuildPlanMyself(props) {
  return (
    <Container>
      <Header>
        <From>From</From>
        <To>To</To>
      </Header>
      <Details>
        <Date>Date</Date>
        <Days>Number of Days</Days>
      </Details>
      <Family>
        <With>with</With>
        <FamilyName>Family</FamilyName>
      </Family>
      <Plan>
        <PlanHeader>
          <PlanTitle>Daywise Plan</PlanTitle>
          <Day>Day</Day>
          <DayNumber>5</DayNumber>
        </PlanHeader>
        <Images>
          <Image src="https://cdn.builder.io/api/v1/image/assets/TEMP/c614b0fd-839a-4044-9b19-1f7504085236?apiKey=57837d822bdf4b509d730a604066e372&" />
          <ImageSpacer />
          <Image src="https://cdn.builder.io/api/v1/image/assets/TEMP/5744ff1a-dd40-4377-92c1-b14e209c4fca?apiKey=57837d822bdf4b509d730a604066e372&" />
          <ImageSpacer />
          <Image src="https://cdn.builder.io/api/v1/image/assets/TEMP/288c56cb-e4dd-4ba6-b9d6-41eeb142d5a7?apiKey=57837d822bdf4b509d730a604066e372&" />
          <ImageSpacer />
          <Image src="https://cdn.builder.io/api/v1/image/assets/TEMP/8313d432-b66c-4274-a32b-ace55f843797?apiKey=57837d822bdf4b509d730a604066e372&" />
        </Images>
      </Plan>
    </Container>
  );
}

const Container = styled.div`
  justify-content: center;
  align-items: flex-start;
  background-color: #fff;
  display: flex;
  flex-direction: column;
  padding: 0 20px;
`;

const Header = styled.div`
  border-radius: 46px;
  background-color: #000;
  align-self: center;
  display: flex;
  margin-top: 52px;
  width: 100%;
  max-width: 1341px;
  flex-direction: column;
  padding: 53px 20px 72px;

  @media (max-width: 991px) {
    max-width: 100%;
    margin-top: 40px;
  }
`;

const Details = styled.div`
  align-self: start;
  display: flex;
  margin-left: 38px;
  width: 780px;
  max-width: 100%;
  align-items: flex-start;
  justify-content: space-between;
  gap: 20px;

  @media (max-width: 991px) {
    flex-wrap: wrap;
  }
`;

const From = styled.div`
  justify-content: center;
  color: #fff;
  letter-spacing: 1px;
  align-self: start;
  margin-top: 11px;
  max-width: 534px;
  flex-grow: 1;
  flex-basis: auto;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const To = styled.div`
  justify-content: center;
  color: #fff;
  letter-spacing: 1px;
  align-self: start;
  max-width: 534px;
  flex-grow: 1;
  flex-basis: auto;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const Family = styled.div`
  align-self: center;
  display: flex;
  margin-top: 90px;
  width: 100%;
  max-width: 981px;
  align-items: flex-start;
  justify-content: space-between;
  gap: 20px;

  @media (max-width: 991px) {
    max-width: 100%;
    flex-wrap: wrap;
    margin-top: 40px;
  }
`;

const With = styled.div`
  justify-content: center;
  color: #fff;
  letter-spacing: 1px;
  align-self: start;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const FamilyName = styled.div`
  justify-content: center;
  color: #fff;
  letter-spacing: 1px;
  align-self: start;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const Plan = styled.div`
  border-radius: 46px;
  background-color: #000;
  align-self: center;
  display: flex;
  width: 100%;
  max-width: 1341px;
  flex-direction: column;
  margin: 43px 0 54px;
  padding: 53px 20px 126px;

  @media (max-width: 991px) {
    max-width: 100%;
    margin: 40px 0;
  }
`;

const PlanHeader = styled.div`
  align-self: center;
  display: flex;
  margin-bottom: -25px;
  width: 100%;
  max-width: 1122px;
  flex-direction: column;

  @media (max-width: 991px) {
    max-width: 100%;
    margin-bottom: 10px;
  }
`;

const PlanTitle = styled.div`
  justify-content: center;
  color: #fff;
  letter-spacing: 1px;
  margin-top: 9px;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const Day = styled.div`
  justify-content: center;
  color: #fff;
  letter-spacing: 1px;
  align-self: start;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const DayNumber = styled.div`
  justify-content: center;
  color: #fff;
  text-align: center;
  letter-spacing: 1px;
  align-self: start;
  margin-top: 5px;
  font: 400 50px Gurajada, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const Images = styled.div`
  align-self: end;
  display: flex;
  width: 943px;
  max-width: 100%;
  align-items: flex-start;
  gap: 0px;
  margin: 137px 39px 0 0;

  @media (max-width: 991px) {
    flex-wrap: wrap;
    justify-content: center;
    margin: 40px 10px 0 0;
  }
`;

const Image = styled.img`
  aspect-ratio: 1;
  object-fit: cover;
  object-position: center;
  width: 100px;
  overflow: hidden;
  border-radius: 50%;
  align-self: stretch;
  max-width: 100%;
`;

const ImageSpacer = styled.div`
  background-color: #00ad79;
  align-self: center;
  width: 181px;
  height: 6px;
  margin: auto 0;
`;

export default BuildPlanMyself;
